// TextBox.js

import React from 'react';
import PropTypes from 'prop-types';

const TextBox = ({ value }) => {
  const mode = notice-text ? 'text-textbox--notice-text' : 'text-textbox'
  return (
    <div>
      {value}
    </div>
  );
};

TextBox.propTypes = {
  /**
   * 보여줄 문자열 값
   */
  value: PropTypes.string.isRequired,
};

export default Textbox;
